import React, { Component } from "react";

import {Container, Row, Col,Image} from 'react-bootstrap';
import coba from '../../assets/images/coba.jpg';

import Rumah from '../../assets/icon_kategori/1rumahv3.png';
import Apartemen from '../../assets/icon_kategori/1rumahv3.png';
import Indekos from '../../assets/icon_kategori/1rumahv3.png';
import Tanah from '../../assets/icon_kategori/1rumahv3.png';
import Ruko from '../../assets/icon_kategori/1rumahv3.png';


import Kantor from '../../assets/icon_kategori/1rumahv3.png';
import Kios from '../../assets/icon_kategori/1rumahv3.png';
import Villa from '../../assets/icon_kategori/1rumahv3.png';
import Gedung from '../../assets/icon_kategori/1rumahv3.png';
import Pabrik from '../../assets/icon_kategori/1rumahv3.png';

class Kategori extends Component {
  render() {
    return (
      <div>
        <h2>Kategori Utama</h2>
        <Container>
          <Row>
            <Col>
               <Image style={{width:100,height:100}} src={Rumah} rounded alt="logo"/>
              <span>Rumah</span>
            </Col>
            <Col>       
              <Image style={{width:100,height:160}} src={Apartemen} rounded alt="logo"/>
              <span>Apartemen</span></Col>
            <Col>
              <Image style={{width:100,height:160}} src={Indekos} rounded alt="logo"/>
              <span>Indekos</span>
            </Col>
            <Col>
              <Image style={{width:100,height:160}} src={Tanah} rounded alt="logo"/>
              <span>Tanah</span>
            </Col>
            <Col>
              <Image style={{width:100,height:160}} src={Ruko} rounded alt="logo"/>
              <span>Ruko</span>
            </Col>
          </Row>
        </Container>

        <Container >
          <Row>
            <Col>
               <Image style={{width:100,height:160}} src={Kantor} rounded alt="logo"/>
              <span>Kantor</span>
            </Col>
            <Col>       
              <Image style={{width:100,height:160}} src={Kios} rounded alt="logo"/>
              <span>Kios</span></Col>
            <Col>
              <Image style={{width:100,height:160}} src={Villa} rounded alt="logo"/>
              <span>Villa</span>
            </Col>
            <Col>
              <Image style={{width:100,height:160}} src={Gedung} rounded alt="logo"/>
              <span>Gedung</span>
            </Col>
            <Col>
              <Image style={{width:100,height:160}} src={Pabrik} rounded alt="logo"/>
              <span>Pabrik</span>
            </Col>
          </Row>
        </Container>


      </div>
    );
  }
}

export default Kategori;
